    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from January through April
    of 1956. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, big game animals, predators,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include grazing.
    The public relations section of the report describes Refuge visitors and violations.
